// @flow
import * as React from "react";
import { pagingCountries } from "./CountryService";
import { makeObservable, observable, action,autorun } from "mobx";

class CountryStore extends React.Component {
  countryList = [];
  constructor() {
    makeObservable(this, {
      countryList: observable,
      post: action.bound,
      put: action.bound,
      delete: action.bound,
      load: action.bound,
    });
  }

  post = async (model) => {};
  put = async (model) => {};
  delete = async (id) => {};

  load = async () => {
    const searchObject = {
      pageIndex: 1,
      pageSize: 10,
      keyword: "",
    };
    let data = await pagingCountries(searchObject);

    this.countryList = data.data.content;
  };
}
export default CountryStore;
